// src/App.js
import React, { useContext } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Register from "./components/Auth/Register";
import Login from "./components/Auth/Login";
import CarList from "./components/Cars/CarList";
import CarUploadForm from "./components/Cars/CarUploadForm";
import Logout from "./components/Auth/logout";
import { AuthProvider, AuthContext } from "./context/AuthContext";
import "./styles/Navbar.css";

const Navigation = () => {
  const { user, logout } = useContext(AuthContext);

  return (
    <nav className="nav">
      <Link to="/" className="nav-btn">Cars</Link>
      <Link to="/upload-car" className="nav-btn">Upload Car</Link>

      {!user ? (
        <>
          <Link to="/login" className="nav-btn">Login</Link>
          <Link to="/register" className="nav-btn">Register</Link>
        </>
      ) : (
        <>
          <button onClick={logout} className="nav-btn logout-btn">Logout</button>
        </>
      )}
    </nav>
  );
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Navigation />

        <Routes>
          <Route path="/" element={<CarList />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/upload-car" element={<CarUploadForm />} />
          <Route path="/logout" element={<Logout />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
